import React, { useState, useEffect, Suspense, lazy } from "react";
import Container from "reactstrap/lib/Container";
import Chart from "./Chart";
import moment from "moment";
import { chart_Data_Urls } from "../../config/chartsData";
import {
  Row,
  Col,
  Card,
  CardBody,
  CardTitle,
  CardText,
  Nav,
  NavItem,
  TabContent,
  NavLink,
  TabPane,
  ButtonToolbar,
  ButtonGroup,
  Button,
} from "reactstrap";
import classnames from "classnames";
import "./css/mydashboard.css";
import { Link } from "react-router-dom";
import UseDashboard from "./useDashboard";
// import ChartComponent from "./chartComponent";

const MyDashboard = () => {
  const currentMonth = new Date();
  const {
    t_ID,
    maxDataAge,
    setMaxDataAge,
    loaded,
    activeTabJustify,
    toggleCustomJustified,
    Loader,
    financeCardddata,
    generalCardddata,
    locationCardddata,
    brandCardddata,
    usersCardddata,
  } = UseDashboard();

  // const { chartsView } = ChartComponent();
  const [selectedDate, setSelectedDate] = useState("");
  const [filterDate, setFilterDate] = useState({});

  useEffect(() => {
    if (selectedDate !== "") {
      setFilterDate({ createdAt: selectedDate });
    }
  }, [selectedDate]);

  const chartsView = () => {
    // lazy(() => {
    if (activeTabJustify === "1") {
      return (
        <div key={activeTabJustify}>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_By_Locations}
                  // chartId={"625134b0-5d61-46db-86c0-48eef0760b6e"}
                />
              </div>
            </Col>

            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  // chartId={"625139bf-45ca-4d14-85ba-9a0e96d9ab76"}
                  chartId={chart_Data_Urls.Bookings_By_Brands}
                />
              </div>
            </Col>
          </Row>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_by_Brands}
                  // chartId={"6256af9a-04a5-4f01-8929-ba406cf900cb"}
                />
              </div>
            </Col>
            {/* <Col md={1}></Col> */}
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_By_Booking_Type}
                  // chartId={"62514999-70f4-431b-8d96-68f6a4c6a942"}
                />
              </div>
            </Col>
          </Row>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Bookings_By_Resource_Type}
                  // chartId={"625154e9-ed04-4f19-8b12-9548acd2508c"}
                />
              </div>
            </Col>
            {/* <Col md={1}></Col> */}
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_By_Resource_Type}
                  // chartId={"62514d58-905f-40e2-83f4-4c6b1b2877eb"}
                />
              </div>
            </Col>
          </Row>
        </div>
      );
    }
    if (activeTabJustify === "2") {
      return (
        <div key={activeTabJustify}>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_By_Locations}
                  // chartId={"625134b0-5d61-46db-86c0-48eef0760b6e"}
                />
              </div>
            </Col>

            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_By_Resource_Type}
                  // chartId={"62514d58-905f-40e2-83f4-4c6b1b2877eb"}
                />
              </div>
            </Col>
          </Row>

          <Row className="mt-5">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_by_Brands}
                  // chartId={"6256af9a-04a5-4f01-8929-ba406cf900cb"}
                />
              </div>
            </Col>

            <Col md={6}>
              {/* <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={"62514d58-905f-40e2-83f4-4c6b1b2877eb"}
                />
              </div> */}
            </Col>
          </Row>
        </div>
      );
    }
    if (activeTabJustify === "3") {
      return (
        <div key={activeTabJustify}>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_By_Locations}
                  // chartId={"625134b0-5d61-46db-86c0-48eef0760b6e"}
                />
              </div>
            </Col>

            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Bookings_By_Locations}
                  // chartId={"62515345-2438-4c2b-8a7d-0245e2511098"}
                />
              </div>
            </Col>
          </Row>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Bookings_By_Resource_Type}
                  // chartId={"625154e9-ed04-4f19-8b12-9548acd2508c"}
                />
              </div>
            </Col>

            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Locations_With_Booking_Types}
                  // chartId={"6257b292-342b-4a2c-83f5-dfcb02f4bae1"}
                />
              </div>
            </Col>
          </Row>
        </div>
      );
    }
    if (activeTabJustify === "4") {
      return (
        <div key={activeTabJustify}>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Bookings_By_Brands}
                  // chartId={"625139bf-45ca-4d14-85ba-9a0e96d9ab76"}
                />
              </div>
            </Col>

            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Revenue_by_Brands}
                  // chartId={"6256af9a-04a5-4f01-8929-ba406cf900cb"}
                />
              </div>
            </Col>
          </Row>
        </div>
      );
    }
    if (activeTabJustify === "5") {
      return (
        <div key={activeTabJustify}>
          <Row className="mt-3">
            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Users_By_Industry}
                  // chartId={"6256aed7-adc9-4235-8e2e-c4d5e33c4cd1"}
                />
              </div>
            </Col>

            <Col md={6}>
              <div className="charts">
                <Chart
                  height={"350px"}
                  width={"480px"}
                  filter={maxDataAge}
                  chartId={chart_Data_Urls.Users_By_Position}
                  // chartId={"6256af21-ad42-491c-886b-c379e048fc5a"}
                />
              </div>
            </Col>
          </Row>
        </div>
      );
    }
    return;
    // });
  };
  return (
    <>
      {loaded ? (
        <Loader loaded={false} className="spinner" />
      ) : (
        <div className="page-content">
          <Card
            className=" generalcardborders"
            style={{ backgroundColor: "#FEFEFE " }}
          >
            <Container fluid>
              <Row className="mt-4">
                <Col md={4} lg={4} sm={12}>
                  <Link to={`/requestbookings/${t_ID}`} className="link">
                    <Card className="cardcss">
                      <CardBody>
                        <Row>
                          <Col md={10} lg={10} sm={10}>
                            <CardTitle className="headings">Bookings</CardTitle>
                          </Col>
                          <Col md={2} lg={2} sm={2}>
                            <i className="fas fa-bell icons"></i>
                          </Col>
                        </Row>
                        <Row className="mt-3">
                          <Col md={10} lg={10} sm={10}></Col>
                          <Col md={2} lg={2} sm={2}>
                            <i className="fas fa-arrow-right"></i>
                          </Col>
                        </Row>
                      </CardBody>
                    </Card>
                  </Link>
                </Col>

                <Col md={4} lg={4} sm={12}>
                  <Link to="/checkedincustomer" className="link">
                    <Card className="cardcss">
                      <CardBody>
                        <Row>
                          <Col md={10} lg={10} sm={10}>
                            <CardTitle className="headings">
                              Checked-in customers
                            </CardTitle>
                          </Col>
                          <Col md={2} lg={2} sm={2}>
                            <i className="fas fa-users icons"></i>
                          </Col>
                        </Row>
                        <Row className="mt-3">
                          <Col md={10} lg={10} sm={10}>
                            <CardText className="amount"></CardText>
                          </Col>
                          <Col md={2} lg={2} sm={2}>
                            <i className="fas fa-arrow-right "></i>
                          </Col>
                        </Row>
                      </CardBody>
                    </Card>
                  </Link>
                </Col>
                <Col md={4} lg={4} sm={12}></Col>
              </Row>

              <div>
                <div>
                  <Row className="mt-5 mb-2">
                    <Col md={8}>
                      {/* <Card className="bg-transparent generalcardborders"> */}
                      <Nav tabs className="nav-tabs-custom nav-justified">
                        <NavItem>
                          <NavLink
                            style={{
                              cursor: "pointer",
                              backgroundColor: "transparent",
                            }}
                            className={classnames({
                              active: activeTabJustify === "1",
                            })}
                            onClick={() => {
                              toggleCustomJustified("");
                              toggleCustomJustified("1");
                            }}
                          >
                            <span className="d-none d-sm-block dashboardtab1 ">
                              General
                            </span>
                          </NavLink>
                        </NavItem>
                        <NavItem>
                          <NavLink
                            style={{
                              cursor: "pointer",
                              backgroundColor: "transparent",
                            }}
                            className={
                              ("navbuttonborder",
                              classnames({
                                active: activeTabJustify === "2",
                              }))
                            }
                            onClick={() => {
                              toggleCustomJustified("");
                              toggleCustomJustified("2");
                            }}
                          >
                            <span className="d-none d-sm-block dashboardtab1 ">
                              Finance
                            </span>
                          </NavLink>
                        </NavItem>
                        <NavItem>
                          <NavLink
                            style={{
                              cursor: "pointer",
                              backgroundColor: "transparent",
                            }}
                            className={classnames({
                              active: activeTabJustify === "3",
                            })}
                            onClick={() => {
                              toggleCustomJustified("");
                              toggleCustomJustified("3");
                            }}
                          >
                            <span className="d-none d-sm-block dashboardtab1">
                              Locations
                            </span>
                          </NavLink>
                        </NavItem>
                        <NavItem>
                          <NavLink
                            style={{
                              cursor: "pointer",
                              backgroundColor: "transparent",
                            }}
                            className={classnames({
                              active: activeTabJustify === "4",
                            })}
                            onClick={() => {
                              toggleCustomJustified("");
                              toggleCustomJustified("4");
                            }}
                          >
                            <span className="d-none d-sm-block dashboardtab1">
                              Brands
                            </span>
                          </NavLink>
                        </NavItem>
                        <NavItem>
                          <NavLink
                            style={{
                              cursor: "pointer",
                              backgroundColor: "transparent",
                            }}
                            className={classnames({
                              active: activeTabJustify === "5",
                            })}
                            onClick={() => {
                              toggleCustomJustified("");
                              toggleCustomJustified("5");
                            }}
                          >
                            <span className="d-none d-sm-block dashboardtab1">
                              Users
                            </span>
                          </NavLink>
                        </NavItem>
                        <hr />
                        <hr />
                      </Nav>
                      {/* </Card> */}

                      <TabContent activeTab={activeTabJustify}>
                        <TabPane tabId="1" className="p-3"></TabPane>
                        <TabPane tabId="2" className="p-3"></TabPane>
                        <TabPane tabId="3" className="p-3"></TabPane>
                        <TabPane tabId="4" className="p-3"></TabPane>
                        <TabPane tabId="5" className="p-3"></TabPane>
                      </TabContent>
                    </Col>
                    <Col md={4}></Col>
                  </Row>
                </div>
                {activeTabJustify === "1" ? (
                  <Row>
                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Bookings Today
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {generalCardddata
                                  ? generalCardddata.todayBookings
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Total Sales
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {generalCardddata
                                  ? generalCardddata.totalSales
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Check-ins Today
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {" "}
                                {generalCardddata
                                  ? generalCardddata.todayCheckIns
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>
                  </Row>
                ) : activeTabJustify === "2" ? (
                  <Row>
                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Total Sales
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {" "}
                                {financeCardddata
                                  ? financeCardddata.totalSales
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Best Selling Products
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {financeCardddata
                                  ? financeCardddata.bestSellingProduct
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Top Brand By Revenue
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {financeCardddata
                                  ? financeCardddata.topBrand.name
                                      .charAt(0)
                                      .toUpperCase() +
                                    financeCardddata.topBrand.name.slice(1)
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>
                  </Row>
                ) : activeTabJustify === "3" ? (
                  <Row>
                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Top Location
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {locationCardddata
                                  ? locationCardddata.topLocationByBookings.name
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Top Resource Type
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {locationCardddata
                                  ? locationCardddata.topResourceTtype
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>
                  </Row>
                ) : activeTabJustify === "4" ? (
                  <Row>
                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Top Brand By Bookings
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {brandCardddata
                                  ? brandCardddata.topBrandsByBookings.name
                                      .charAt(0)
                                      .toUpperCase() +
                                    brandCardddata.topBrandsByBookings.name.slice(
                                      1
                                    )
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>
                  </Row>
                ) : activeTabJustify === "5" ? (
                  <Row>
                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Total Users
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {usersCardddata
                                  ? usersCardddata.totalUsers
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Top User Type(Industry)
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {usersCardddata
                                  ? usersCardddata.topUsersByIndustry.name
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>

                    <Col md={3} lg={3} sm={12}>
                      <Card className="cardcss dashboardsecondcard">
                        <CardBody>
                          <Row>
                            <Col md={12} lg={12} sm={12}>
                              <CardTitle className="headings1">
                                Top User Type(Position)
                              </CardTitle>
                            </Col>
                          </Row>
                          <Row className="">
                            <Col md={12} lg={12} sm={12}>
                              <CardText className="amount1">
                                {usersCardddata
                                  ? usersCardddata.topBrandsByBookings.name
                                  : "0"}
                              </CardText>
                            </Col>
                          </Row>
                        </CardBody>
                      </Card>
                    </Col>
                  </Row>
                ) : null}
              </div>

              <div>
                <Row className="mt-4 ">
                  <Col md={6}></Col>
                  <Col md={6}>
                    <ButtonToolbar>
                      <ButtonGroup>
                        <Button
                          // color="light"
                          bsStyle="light"
                          style={{ backgroundColor: "white" }}
                          onClick={() => {
                            setMaxDataAge({
                              createdAt: {
                                $gte: new Date(
                                  moment().startOf("day").toISOString()
                                ),
                                $lte: new Date(),
                              },
                            });
                          }}
                        >
                          <span className="dashboaedfilter">Today</span>
                        </Button>

                        <Button
                          // color="light"
                          bsStyle="light"
                          style={{ backgroundColor: "white" }}
                          onClick={() => {
                            setMaxDataAge({
                              createdAt: {
                                $gte: new Date(
                                  moment()
                                    .subtract(1, "day")
                                    .startOf("day")
                                    .toISOString()
                                ),

                                $lte: new Date(
                                  moment()
                                    .subtract(1, "day")
                                    .endOf("day")
                                    .toISOString()
                                ),
                              },
                            });
                          }}
                        >
                          <span className="dashboaedfilter">Yesterday</span>
                        </Button>
                        <Button
                          // color="light"
                          bsStyle="light"
                          style={{ backgroundColor: "white" }}
                          onClick={() => {
                            setMaxDataAge({
                              createdAt: {
                                $gte: new Date(
                                  moment()
                                    .subtract(1, "weeks")
                                    .startOf("isoWeek")
                                    .toISOString()
                                ),
                                $lte: new Date(
                                  moment()
                                    .subtract(1, "weeks")
                                    .endOf("isoWeek")
                                    .toISOString()
                                ),
                              },
                            });
                          }}
                        >
                          <span className="dashboaedfilter">Last week</span>
                        </Button>

                        <Button
                          // color="light"
                          bsStyle="light"
                          style={{ backgroundColor: "white" }}
                          onClick={() => {
                            const today = moment().format("YYYY-MM ");
                            setMaxDataAge({
                              createdAt: {
                                $gte: new Date(
                                  moment(today).startOf("month").toISOString()
                                ),
                                $lte: new Date(moment().toISOString()),
                              },
                            });
                          }}
                        >
                          <span className="dashboaedfilter">This month</span>
                        </Button>
                        <Button
                          // color="light"
                          bsStyle="light"
                          style={{ backgroundColor: "white" }}
                          onClick={() => {
                            const today = moment().format("YYYY-MM ");
                            setMaxDataAge({
                              createdAt: {
                                $gte: new Date(
                                  moment(today + "1")
                                    .subtract(1, "months")
                                    .startOf("month")
                                    .toISOString()
                                ),
                                $lte: new Date(
                                  moment(today + "1")
                                    .subtract(1, "months")
                                    .endOf("month")
                                    .toISOString()
                                ),
                              },
                            });
                          }}
                        >
                          <span className="dashboaedfilter">Last month</span>
                        </Button>
                      </ButtonGroup>
                    </ButtonToolbar>
                  </Col>
                </Row>
              </div>
              <Suspense fallback={<div>please wait ... </div>}>
                {chartsView()}
              </Suspense>
            </Container>
          </Card>
        </div>
      )}
    </>
  );
};

export default MyDashboard;
